						.setHTML(`<b>Line:</b> ${line.properties.name}<br><b>Location:</b> ${point.properties.location.toLocaleString()} ${line.properties.kp.toUpperCase()}`)
						.addTo(map);
					} else {
						popup.remove();
					}
				});
			});

			function addLine(id, source, color, highlight) {
				map.addSource(id, {
					'type': 'geojson',
					'data': source,
				});

				map.addLayer({
					'id': id,
					'type': 'line',
					'source': id,
					'layout': {
						'line-join': 'round',
						'line-cap': 'round'
					},
					'paint': {
						'line-color': color,
						'line-width': 4
					}
				});

			map.on('click', function(e) {
				// Prevent the default map drag behavior.
				e.preventDefault();

				let closest_line = null;
				let last_point = null;

				for (let [key, line] of Object.entries(lines)) {
		  			const point = turf.nearestPointOnLine(line.geometry, turf.point([e.lngLat.lng, e.lngLat.lat]));
		  			if (closest_line == null || point.properties.dist < last_point.properties.dist) {
		  				closest_line = line;
		  				last_point = point;
		  			}
		  			console.log(line);
				}
				 
				const coordinates = last_point.geometry.coordinates;
				 
				// Ensure that if the map is zoomed out such that multiple
				// copies of the feature are visible, the popup appears
				// over the copy being pointed to.
				while (Math.abs(e.lngLat.lng - coordinates[0]) > 180) {
					coordinates[0] += e.lngLat.lng > coordinates[0] ? 360 : -360;
				}
				 
				// Populate the popup and set its coordinates
				// based on the feature found.
				popup
				.setLngLat(coordinates)
				.setHTML(`<b>Line:</b> ${closest_line.properties.name}<br><b>Location:</b> ${last_point.properties.location.toLocaleString()} ${closest_line.properties.kp.toUpperCase()}`)
				.addTo(map);
			});
